    "2016-07-27T22:20:20.299681",nt"name": "stillwater-national-wildlife-refuge-and-stillwater-wildlife-management-area-annual-water-m",nt"isopen":
    false,nt"url": null,nt"notes": "An estimated 70,000 acre feet(AF) of water
    are needed annually to maintain 14,000 acres of permanent marsh currently administered
    by the Stillwater NWR. The 1994 water projections forecast a 57% irrigation delivery
    year starting in early April ending in mid-September. Based on projected water storage
    and releases from Lahontan Reservoir, return flows to the refuge are estimated to
    be 7,800-13,600 AF. These flows will be augmented by nearly 2,300 AF of acquired
    primewater deliveries providing an estimated 10,100-15,900 AF to maintain 2,000-3,200
    wetland acres at SNWR.",nt"license_title": "License Not Specified",nt"extras":
